  \"2013-03-14T19:31:39.172062\",\n\t\"name\": \"aspen-delineation-sequoia-national-forest-ds378\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The database represents delineations of
  aspen stands associated with stand assessment data (SEQUOIA_NF_PTS) collected in
  aspen stands in the Cannell Meadows Ranger District, Sequoia National Forest, Tulare
  County, California. The aspen inventory from Sequoia National Forest is the only
  dataset in the state aspen database that was derived from a publication (Pillsbury
  1994). The CDFG digitized this dataset by scanning paper maps within the publication,
  and digitizing and geo-referencing polygons from the electronic maps. Two assessment
  tables were created from the tables within the publication-one was a summery of
  the plot information and the other was a summery of the stand information which
  was an average of the plots within each stand. The report assessed information such
  as: topographic features, stand vigor, downed logs per acre, percent conifer in
  stand, total number of trees and aspen trees per acre in stand, and percentage of
  hiding cover for fawns and does. The report also examined the number of tr Pillsbury
  1994, N.H., Ritter, T., Drew, M., and C. Linquist. 1994. Wildlife Habitat Inventory
  of Aspen Stands on the Cannell Meadow Ranger District, Sequoia National Forest.
  Natural Resources Management Department, Cal Poly State Univ., San Luis Obispo,
  California. 551 p. Associated with this polygon layer is a point layer (SEQUOIA_NF_PTS)
  containing aspen stand assessments conducted in conjunction with the aspen stand
  delineations. Data Compilation: The Aspen Delineation Project (ADP) is a collaborative
  effort of the U.S. Forest Service's Pacific Southwest Region, the California Department
  of Fish and Games Resource Assessment Program, and the California Office of Bureau
  of Land Management. Principal Investigator for ADP is David Burton; visit: www.aspensite.org
  for more information regarding the ADP. The Department of Fish and Games, Resource
